import React,{ Fragment } from 'react';

const RenderPage = ( props ) => {
  console.log('Render page : ',typeof props.data);
  // const renderData = ( ) => {
  //   return props.data && Object.values(props.data).map((el,i) => {
  //     console.log(el)
  //         return (
  //         <Fragment key={ i }>
  //           <td>{el.movieName }</td>
  //           <td>{ el.duration }</td>
  //           <td>{el.ratings }</td>
  //         </Fragment>
  //         );

  //   })
  // }
    return (
      <div>
         <table className="ui table">
            <thead>
              <tr>
                <th>Movie Name</th>
                <th>Ratings</th>
                <th>Duration</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                  { props.data && Object.values(props.data).map((el,i) => {
                    console.log(el)
                        return (
                        <Fragment key={ i }>
                          <td>{el.movieName }</td>
                          <td>{ el.duration }</td>
                          <td>{el.ratings }</td>
                        </Fragment>
                        );

                  })
     }
              </tr>
            </tbody>
        </table>
      </div>
    );
}

export default RenderPage;
